import React from "react";

const SellerDetails = () => {
  return (
    <div className="px-2 lg:px-7 pt-5 ">
      <div className="text-[20px] font-bold mb-3 ">
        <h1>Sellers Request</h1>
      </div>
    </div>
  );
};

export default SellerDetails;
